import React from 'react'; 

class Searchinput extends React.Component{
	render(){
		return(
			<div className = 'ui segment'> 
				<form action="ui form">
					<div className='field'>
						<div className='ui massive icon input'>
							<input type= "text" placeholder = 'search...' />
							
						</div>
					</div>
				</form>
			</div>
			)
	}
}

export default Searchinput;
